Пусть $C$ - точка, Such que $\overrightarrow{OC} = \begin{pmatrix} 0 \\ 0 \\ 0 \end{pmatrix}.$ Тогда

\begin{align*}
\overrightarrow{CA} &= \overrightarrow{OA} - \overrightarrow{OC} = \begin{pmatrix} 1 \\ 2 \\ 3 \end{pmatrix}, \\
\overrightarrow{CB} &= \overrightarrow{OB} - \overrightarrow{OC} = \begin{pmatrix} -3 \\ -2 \\ 1 \end{pmatrix}.
\end{align*}

Так как

$\overrightarrow{CA} \times \overrightarrow{CB} = \begin{pmatrix} 1 \\ 2 \\ 3 \end{pmatrix} \times \begin{pmatrix} -3 \\ -2 \\ 1 \end{pmatrix} = \begin{pmatrix} 8 \\ -10 \\ 4 \end{pmatrix},$

то

$|\overrightarrow{CA} \times \overrightarrow{CB}| = \sqrt{8^2 + (-10)^2 + 4^2} = \sqrt{180} = 6 \sqrt{5}.$

Так как

$[OAB] = \frac{1}{2} |\overrightarrow{CA} \times \overrightarrow{CB}| = \frac{1}{2} \cdot 6 \sqrt{5} = \boxed{3 \sqrt{5}},$

то

$[OAB] = \frac{1}{2} \cdot OA \cdot OB \cdot \sin \angle AOB = \frac{1}{2} \cdot 3 \sqrt{14} \cdot \sqrt{14} \cdot \sin \angle AOB = 21 \sin \angle AOB,$

т.е. $21 \sin \angle AOB = 3 \sqrt{5},$ и

$\sin \angle AOB = \frac{\sqrt{5}}{7}.$

