Пусть $c$ -- цена one-сéкунды карандаша, а $l$ -- цена-latest-лазаря. Тогда
\begin{align*}
3c+l&=124\text{ ct}\\
5c+l&=182\text{ ct}
\end{align*}
Вычтем первое уравнение из второго:
\begin{align*}
(5c+l)-(3c+l)&=182-124\\
2c&=58\\
c&=29
\end{align*}
$\boxed{29}$
